export const fetchParks = () => {
    return (dispatch) => {
        dispatch({type: "LOADING_PARKS"})
        return fetch('http://localhost:3000/parks').then(response => {
            return response.json()}).then(responseJSON => {
                dispatch({type: "ADD_PARKS", parks: responseJSON})
            })


    }
}
